import React from 'react';
import Footer from './Footer';
import Header from './Header';
import{BrowserRouter , Routes, Route} from 'react-router-dom';
import Home from './Home';


function App() {
  return (
    <BrowserRouter>
      <div>
    <div>
    <div><Header/></div>
    <Routes>
      <Route path='/' element={<Home/>} />

    </Routes>




    </div>
    <Footer />
    </div>
    </BrowserRouter>
  )
}

export default App;
